DROP TABLE IF EXISTS `t_s_task_csf`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_s_task_csf` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_name` varchar(24) NOT NULL,
  `task_type` tinyint(4) NOT NULL COMMENT '0-新手任务,1-普通任务,2-特殊任务',
  `task_status` tinyint(4) NOT NULL COMMENT '日常任务种类（1 表示完成多少局， 2 表示胜利多少局， 3 表示连胜多少局）',
  `pre_task_id` tinyint(4) NOT NULL COMMENT '前置任务id',
  `task_prize_type` varchar(10) NOT NULL COMMENT '任务奖励类型(可能有多种奖励0-金币,1-经验)',
  `task_prize_num` varchar(30) NOT NULL COMMENT '任务奖励的数值',
  `task_desc` varchar(50) NOT NULL COMMENT '任务的描述',
  `task_limit_level` tinyint(4) NOT NULL,
  `is_num_task` tinyint(4) NOT NULL COMMENT '是否是数值任务',
  `task_num` int(9) NOT NULL COMMENT '数值任务所需的值',
  `task_level` tinyint(4) DEFAULT NULL COMMENT '任务等级(分三级任务1,2,3)',
  `task_condition` varchar(20) DEFAULT NULL COMMENT '类型 				prar1							                           para2                     \n0－战斗           		0－无条件，1－胜利，2-失败，3－平局	                          0－无条件，1－斋，2-非斋\n3－更新信息		0－无条件，1－注册为会员，2-头像\n4－好友			\n5－邀请游戏\n6－获得奴隶		\n7－建筑升级		1－大本营，2－研究室，3－工厂，4－仓库                         要求等级\n8－金杯数量		\n9－充值\n11-研究卡片		卡片类型id,0－无条件        				                           要求等级,0－无条件\n12-生产卡片		卡片类型ID,0－无条件                                                                要求数量,0－无条件   ',
  `task_is_call_one` tinyint(4) DEFAULT NULL COMMENT '是否是斋局(0-无条件,1-斋局,2-非斋局,3-填信息,4-加好友)',
  `task_is_continuous` tinyint(4) DEFAULT NULL COMMENT '是否是连续任务(0-无条件,1-连续,2-非连续)',
  `task_result` tinyint(4) DEFAULT NULL COMMENT '任务结果条件(0-无条件,1-完成游戏,2-完成平局,3-获得胜利,4-灌醉用户)',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

