DROP TABLE IF EXISTS `t_u_chat`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_u_chat` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `game_state` tinyint(4) DEFAULT NULL COMMENT '玩家游戏的状态(-1：表示任何状态 0表示还没玩游戏 1表示输 2表示不输不赢 3表示胜利)',
  `weight` tinyint(4) DEFAULT NULL COMMENT '等级（权值）',
  `probability` tinyint(4) DEFAULT NULL COMMENT '回答的概率',
  `type` tinyint(4) DEFAULT NULL COMMENT '机器人类型（-1 都匹配 1比较凶的 2比较和蔼的）10代表游戏中结束 11表示机器人叫',
  `regex` varchar(50) DEFAULT NULL COMMENT '正则表达式',
  `answer` varchar(100) DEFAULT NULL COMMENT '回答',
  `voice_id` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=412 DEFAULT CHARSET=utf8;
