INSERT INTO `t_u_chat` VALUES (344,NULL,0,1,10,NULL,'今天心情不错，玩几盘游戏1',0),(345,0,1,127,10,NULL,'寂寞，求败~3',0),(346,0,1,10,10,'游戏中','我喜欢玩游戏的时候聊天',0),(347,0,1,10,10,'游戏中','玩游戏就是要聊天，这样才有意思嘛',0),(348,0,1,10,10,'游戏中','今天不是我赢就是你输！',27),(349,0,1,10,10,'游戏中','让你领救济！',0),(350,0,1,10,10,'游戏中','小学生快回家写作业',0),(352,1,1,50,10,'游戏中','今天不是你倒下就是我倒下！',27),(353,1,1,10,10,'游戏中','不信赢不回来！',0),(354,1,1,10,10,'游戏中','下一盘一定赢你',0),(355,2,1,10,10,'游戏中','不准让我打酱油啊',0),(356,2,1,10,10,'游戏中','你玩的也太好啦！',0),(357,2,1,10,10,'游戏中','我是路过，打酱油的',0),(359,2,1,10,10,'游戏中','别让我总是打酱油啊',0),(360,2,1,10,10,'游戏中','小学生逆袭啦！',0),(361,3,1,50,10,'游戏中','诶哟我去，这运气，忒好啦!',25),(362,3,1,50,10,'游戏中','想赢我？也不看看这是谁的地盘。',26),(363,3,1,10,10,'游戏中','人家只是一只萌萌的小学生',0),(365,1,1,10,10,'游戏中','就问你服不服~',0),(366,3,1,10,10,'游戏中','想赢我，我就笑笑。',0),(367,0,1,10,10,'游戏中','不要走，决战到天亮',0),(368,0,1,127,10,'游戏中','这手气，我也是醉了',0),(369,0,1,10,10,'游戏中','你真是当代小学生的楷模',0),(370,0,1,10,10,'游戏中','我书读的少，你们快来骗我',0),(371,0,1,10,10,'游戏中','你们都让开，我要开始装逼了',27),(372,0,1,10,10,'游戏中','别打了，我再也不装逼了',0),(373,0,1,10,10,'游戏中','冷静下，来包辣条把',0),(374,1,1,50,10,'游戏中','我就是小学生！',27),(375,1,1,10,10,'游戏中','你是哥哥还是美眉啊？',0),(376,1,1,10,10,'游戏中','让你赢一局，这是爱幼',0),(377,2,1,10,10,'游戏中','这画面太美，我不忍直视',0),(378,2,1,10,10,'游戏中','你是逗比请来的猴子吗？',0),(379,2,1,10,10,'游戏中','来吃金克拉',0),(380,2,1,10,10,'游戏中','少先队员之惩戒',0),(381,2,1,10,10,'游戏中','你们是串通好的吧！',0),(382,3,1,50,10,'游戏中','我特长吃饭，特点吃五碗！',25),(383,3,1,50,10,'游戏中','爱我的人请继续，恨我的人别放弃',26),(384,3,1,10,10,'游戏中','图样图森破',0),(385,1,1,10,10,'游戏中','我和我的小伙伴们都惊呆了',0),(386,3,1,10,10,'游戏中','玩玩这把我就回去搬砖',0),(387,0,1,10,10,'游戏中','这是人干的事吗？',0),(388,0,1,127,10,'游戏中','为何要放弃治疗',0),(389,0,1,10,10,'游戏中','土豪我们做朋友把！',0),(390,0,1,10,10,'游戏中','放手，我可不是土豪',0),(391,0,1,10,10,'游戏中','战斗力只有5的渣渣',27),(392,0,1,10,10,'游戏中','注定孤独一生',0),(393,0,1,10,10,'游戏中','不要问我从哪里来，也不要问我为什么',0),(394,1,1,50,10,'游戏中','我擦',27),(395,1,1,10,10,'游戏中','叔叔带你看金鱼',0),(396,1,1,10,10,'游戏中','么么哒',0),(397,2,1,10,10,'游戏中','屌爆了',0),(398,2,1,10,10,'游戏中','神马都是浮云',0),(399,2,1,10,10,'游戏中','大挽尊术',0),(400,2,1,10,10,'游戏中','尼玛',0),(401,2,1,10,10,'游戏中','次奥',0),(402,3,1,50,10,'游戏中','躺着也中枪啊',25),(403,3,1,50,10,'游戏中','请你吃切糕',26),(404,3,1,10,10,'游戏中','请你吃茶叶蛋',0),(405,1,1,10,10,'游戏中','你们倒是说话啊',0),(406,3,1,10,10,'游戏中','别以为你卖萌我就不打你',0),(407,1,1,10,0,'游戏中','南昌最地道的二七王游戏电视上能玩啦！三人二七王，好玩又有趣！',0),(408,1,1,10,0,'游戏中','风靡江西各地区乃至全国的二七王邀你一起体验刺激，精彩并且极富技巧性的休闲竞技体验！',0),(409,1,1,10,0,'游戏中','本版本不删档测试中，欢迎各位玩家查找bug，核实后将奖励海量金币，联系客服领取。',0),(411,1,1,10,0,NULL,'12312344',0);
