--
-- Table structure for table `t_u_player`
--

DROP TABLE IF EXISTS `t_u_player`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_u_player` (
  `UserId` int(11) NOT NULL COMMENT '玩家  id',
  `Account` varchar(45) NOT NULL,
  `UserPwd` varchar(45) NOT NULL COMMENT '玩家密码, 保留字段',
  `UserName` varchar(45) DEFAULT NULL,
  `Sex` tinyint(4) NOT NULL DEFAULT '1' COMMENT '0为女1为男2为未知',
  `Money` int(11) DEFAULT '0' COMMENT '虚拟RMB, 保留字段',
  `Fortune` int(11) DEFAULT '0',
  `Sign` varchar(45) DEFAULT NULL COMMENT '个性签名',
  `Pos` varchar(45) DEFAULT '0,0' COMMENT '玩家坐标信息',
  `PicPath` varchar(300) DEFAULT 'null|null|null|null' COMMENT '照片路径',
  `Win` int(11) DEFAULT '0' COMMENT 'win次数',
  `Lose` int(11) DEFAULT '0' COMMENT 'lose次数',
  `City` varchar(200) DEFAULT NULL COMMENT '用户城市信息',
  `Level` int(11) DEFAULT '1' COMMENT '用户等级',
  `GP` int(11) DEFAULT '0' COMMENT '经验值',
  `Coins` int(11) DEFAULT '0' COMMENT '游戏币',
  `Coins_Temp` int(11) DEFAULT '0',
  `LastLoginDate` timestamp NULL DEFAULT NULL COMMENT '上次登陆时间',
  `LastQiutDate` timestamp NULL DEFAULT NULL COMMENT '最后一次退出时间',
  `IsOnline` tinyint(4) DEFAULT '0' COMMENT '是否在线',
